// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

import "./ExpenseTracker.sol";

contract Factory is Ownable {
  using Counters for Counters.Counter;

  Counters.Counter public trackerCounter;

  address[] public trackers;

  constructor(address tokenAddress) {
    ExpenseTracker expenseTracker = new ExpenseTracker(tokenAddress, owner());
    trackers.push(address(expenseTracker));
    trackerCounter.increment();
  }

  function addTracker(address tokenAddress) external onlyOwner {
    ExpenseTracker expenseTracker = new ExpenseTracker(tokenAddress, owner());
    trackers.push(address(expenseTracker));
    trackerCounter.increment();
  }

  function getTrackers() external view returns (address[] memory) {
    return trackers;
  }
}
